import React, { Component } from 'react'
import Portrait from '../images/Viv.jpg'

export default class About extends Component {
    render() {
        return (
            <section id="about" class='content'>
                <div class='about-item' id="about-text">
                <h1>Hi, I'm Vivien.</h1>
                {/* <p>I’m a sun-seeker, roamer and coffee enthusiast. Okay, let’s get serious now. </p> */}
                {/* <p>I’m a UI and UX designer based in Stockholm. I’m currently doing a master’s degree in User Experience and Interactive Media Design at Södertörn University. 
</p> */}
<p>I design digital experiences and help people make their visions visible to the world.</p>
<p>Good thoughtful design is the key to success for your business.</p>
                <p>Want to work with me? <strong class="blue">Let’s have a coffee.</strong> </p>
                <h3>Why I do what I do</h3>
                <p>Over the last few years, my curiosity about human psychology has grown and I always strive to understand why people act the way they do. UX allows me to combine this with my technical and creative skills, and to design digital interfaces with meaning.</p>

                </div>
                <div class='about-item'>
                    <img src={Portrait} alt='portrait' width='500'></img>
                </div>
            </section>
        )
    }
}
